  const { rutas } = useContext(RutasContext);
  return (
    <>
      {rutas.info && <Info/>}
      {rutas.cDireccion && <CDireccion />}
      {rutas.gClientes && <div>Gesti√≥n Cliente</div>}
      {rutas.gBarrios && <GBarrios />}
    </>
  );
};

export default Gestion;
